import React from "react";
import logo from "../images/logo.png";

const Navbar = () => {
  return (
    <div className="navbar">
      <img src={logo} alt="TRAINERS" className="logo" />

      <img src="" alt="" className="pfp" />
      <span>John Doe</span>
      <button>Logout</button>
    </div>
  );
};

export default Navbar;
